Tests in Rust Rust supports writing software tests to ensure the correctness of the code. There are three styles for testing: Unit testing, Doc testing, and Integration testing. Moreover, Rust supports specifying Dev-dependencies. Tests are functions that are written to verify that the non-test code is running properly. The structure of a test function typically involves some setup, run the “non-test code” you wish to test, then assert whether the results are what we expect. Unit tests should be combined into a test mod with the #[cfg(test)] attribute. To define test functions, functions should be marked with the #[test] attribute before the function definition. For example, look at the following code: pub fn add(a: i32, b: i32) -> i32 { a + b
}
// This is a really bad adding function
#[allow(dead_code)]
fn bad_add(a: i32, b: i32) -> i32 { a - b
} #[cfg(test)]
mod tests { // Note this useful idiom: importing names from outer scope. use super::*; #[test] fn test_add() { assert_eq!(add(1, 2), 3); } #[test] fn test_bad_add() { // This assert would fire and test will fail. // Please note, that private functions can be tested too! assert_eq!(bad_add(1, 2), 3); }
} Tests can be run with cargo test. $ cargo test running 2 tests
test tests::test_bad_add ... FAILED
test tests::test_add ... ok failures:
---- tests::test_bad_add stdout ---- thread 'tests::test_bad_add' panicked at 'assertion failed: `(left == right)` left: `-1`, right: `3`', src/lib.rs:21:8
note: Run with `RUST_BACKTRACE=1` for a backtrace. failures: tests::test_bad_add test result: FAILED. 1 passed; 1 failed; 0 ignored; 0 measured; 0 filtered out
